namespace Shine
{
	/** 帧同步每帧消息(generated by shine) */
	export class FrameSyncFrameResponse extends SceneSResponse
	{
		/** 数据类型ID */
		public static dataID:number=GameResponseType.FrameSyncFrame;
		
		/** 帧数据 */
		public frame:FrameSyncData;
		
		constructor()
		{
			super();
			this._dataID=GameResponseType.FrameSyncFrame;
		}
		
		/** 获取数据类名 */
		public getDataClassName():string
		{
			return "FrameSyncFrameResponse";
		}
		
		/** 读取字节流(简版) */
		protected toReadBytesSimple(stream:BytesReadStream):void
		{
			super.toReadBytesSimple(stream);
			
			this.frame=stream.readDataSimpleNotNull() as FrameSyncData;
			
		}
		
		/** 执行 */
		protected execute():void
		{
			
		}
		
	}
}
